import './Profile.css';

const Profile = () => {
 return (
    <div className="profile-container">
      <h1>Your Profile</h1>
      <div className="profile-details">
        <p>Username: JohnDoe</p>
        <p>Email: johndoe@example.com</p>
        {/* Add more profile details as needed */}
      </div>
    </div>
 );
};

export default Profile;
